package NagoorBabu_Pattern;

public class May_25th_Pattern3 {
//below in decending
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for ( int row=0;row<10;row++){
			for ( int col=0;col<10;col++){
			System.out.print((9-col) + " ");
		}
			System.out.println();

	}

}
}
